import "./map.css";

import React from "react";
import "leaflet/dist/leaflet.css";
import { MapContainer, Marker, TileLayer, Popup } from "react-leaflet";
import MarkerClusterGroup from "react-leaflet-cluster";
import { Icon, divIcon, point } from "leaflet";

export default function Map({ sampleData }) {
  // const markers = [
  //   {
  //     geocode: [48.86, 2.3322],
  //     popUp: "hello pop 1",
  //   },
  //   {
  //     geocode: [48.85, 2.3322],
  //     popUp: "hello pop 2",
  //   },
  //   {
  //     geocode: [48.855, 2.34],
  //     popUp: "hello pop 3",
  //   },
  // ];

  const customIcon = new Icon({
    iconUrl: require("./icons/location.png"),
    iconSize: [38, 38],
  });

  const createCustomClustorIcon = (cluster) => {
    return new divIcon({
      html: `<div class="cluster-icon">${cluster.getChildCount()}</div>`,
      className: "custom-marker-cluster",
      iconSize: point(33, 33, true),
    });
  };
  return (
    <MapContainer center={[48.8566, 2.3225]} zoom={13}>
      <TileLayer
        attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
        url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
      ></TileLayer>
      <MarkerClusterGroup
        chunkedLoading
        iconCreateFunction={createCustomClustorIcon}
      >
        {sampleData.map((marker) => (
          <Marker position={[marker.lat, marker.lng]} icon={customIcon}>
            <Popup> {marker.name}</Popup>
          </Marker>
        ))}
      </MarkerClusterGroup>
    </MapContainer>
  );
}
